import './ExpenseItem.css';
import './Expenses.css';

function Expenses(props){
    return (
        <div className='expenses'>
            <div className='expense-item_description'>
                <h2>{props.title}</h2>
                <div className='expense-item_price'>${props.amount}</div>
            </div>
        </div>
    );
}

export default Expenses;
